from __future__ import print_function
from __future__ import division
from ctypes import *
import os

C_LIB = CDLL(os.path.join(os.path.dirname(os.path.realpath(__file__)), 'seqan_align.so'))

C_LIB.semiGlobalAlignmentAroundLine.argtypes = [c_char_p, c_char_p, c_int, c_int, c_double,
                                                c_double, c_int, c_int]
C_LIB.semiGlobalAlignmentAroundLine.restype = c_void_p

C_LIB.exhaustiveSemiGlobalAlignment.argtypes = [c_char_p, c_char_p, c_int, c_int]
C_LIB.exhaustiveSemiGlobalAlignment.restype = c_void_p

C_LIB.findAlignmentLines.argtypes = [c_char_p, c_char_p, c_int, c_int, c_int]
C_LIB.findAlignmentLines.restype = c_void_p

C_LIB.free_c_string.argtypes = [c_void_p]
C_LIB.free_c_string.restype = None

def main():

    S1_103_691 = ''
    S1_3_137_rev_comp = ''
    S1_75_75_rev_comp = ''

    node_2 = ''
    node_10 = ''
    node_11 = ''

    read = S1_75_75_rev_comp
    ref = node_11

    ptr = C_LIB.findAlignmentLines(read, ref, len(read), len(ref), 2)
    line_result = cast(ptr, c_char_p).value
    C_LIB.free_c_string(ptr)
    if line_result.startswith('Fail'):
        print(line_result)
        quit()
    slope, intercept = [float(x) for x in line_result.split(',')]


    slope = 0.94628571428571 # TEMP
    intercept = -5516 # TEMP

    ptr = C_LIB.semiGlobalAlignmentAroundLine(read, ref, len(read), len(ref), slope, intercept, 55, 0)
    alignment_result = cast(ptr, c_char_p).value
    C_LIB.free_c_string(ptr)
    if alignment_result.startswith('Fail'):
        print(alignment_result)
        quit()
    alignment_result_parts = alignment_result.split(',')

    cigar = alignment_result_parts[0]
    s1_start = int(alignment_result_parts[1])
    s1_end = int(alignment_result_parts[2])
    s2_start = int(alignment_result_parts[3])
    s2_end = int(alignment_result_parts[4])
    aligned_length = int(alignment_result_parts[5])
    match_count = int(alignment_result_parts[6])
    mismatch_count = int(alignment_result_parts[7])
    s2_mismatch_positions = alignment_result_parts[8].split(";")
    insertion_count = int(alignment_result_parts[9])
    s2_insertion_positions = alignment_result_parts[10].split(";")
    deletion_count = int(alignment_result_parts[11])
    s2_deletion_positions = alignment_result_parts[12].split(";")
    edit_distance = int(alignment_result_parts[13])
    percent_identity = float(alignment_result_parts[14])
    milliseconds = int(alignment_result_parts[15])

    print('Seq 1 start:', s1_start)
    print('Seq 1 end:  ', s1_end)
    print('Seq 2 start:', s2_start)
    print('Seq 2 end:', s2_end)
    print('Aligned length:', aligned_length)
    print('Matches:', match_count)
    print('Mismatches:', mismatch_count)
    print('Insertions:', insertion_count)
    print('Deletions:', deletion_count)
    print('Edit distance:', edit_distance)
    print('Percent identity:', ('%.1f' % percent_identity) + '%')
    print('Milliseconds:', milliseconds)


if __name__ == '__main__':
    main()
